import uuid from 'uuid';

const initialState = {
    items: [
        { id: uuid(), name: 'Eggs' },
        { id: uuid(), name: 'Milk' },
        { id: uuid(), name: 'Waffle' },
        { id: uuid(), name: 'Water' }
    ]

}
